import React from "react";
import { NavLink, withRouter, Link } from "react-router-dom";
import { Menu, Button, Image, Item } from "semantic-ui-react";
import { setCurrentUser } from "../actions/user";
import { connect } from "react-redux";

function DashboardClubs(props) {
  return (
    <div>
      <h1>My Clubs</h1>
      <Item.Group>
        <Item>
          <Item.Image size="small" />

          <Item.Content>
            <Item.Header as="a">Cute Dog</Item.Header>
            <Item.Description>
              <p></p>
              <p>
                Many people also have their own barometers for what makes a cute
                dog.
              </p>
            </Item.Description>
          </Item.Content>
        </Item>

        <Item>
          <Item.Image size="small" />

          <Item.Content>
            <Item.Header as="a">Cute Dog</Item.Header>
            <Item.Description />
          </Item.Content>
        </Item>

        <Item>
          <Item.Image size="small" src="/images/wireframe/image.png" />
          <Item.Content header="Cute Dog" />
        </Item>
      </Item.Group>
    </div>
  );
}

const mapStateToProps = (state) => {
  return {
    // user: state.user.user,
    user: state.user,
  };
};

const mapDispatchToProps = (dispatch) => {
  return {
    setCurrentUser: (user) => dispatch(setCurrentUser(user)),
  };
};
export default withRouter(
  connect(mapStateToProps, mapDispatchToProps)(DashboardClubs)
);
